import create from "zustand";
import axios from 'axios';
import {devtools} from "zustand/middleware";

const useUsers = create(
    devtools((set) => ({
     users:[],
     execute: (url) =>{
     axios.get(url).then((res) => {
         set({users:  res.data})
     }).catch(err  => {
         console.log(err);
         })





     }
    }))
);

export default  useUsers;
